import { faMapMarkerAlt, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faGithub, faLinkedinIn } from "@fortawesome/free-brands-svg-icons";
const contactData = [
  {
    icon: faMapMarkerAlt,
    contact: "M'saken, Sousse, Tunisia.",
  },
  {
    icon: faEnvelope,
    contact: "jassemgaaloul123@gmail.com",
  },
  {
    icon: faGithub,
    contact: "github.com/jassem-lab",
  },
  {
    icon: faLinkedinIn,
    contact: "linkedin.com/in/tajamul-husen",
  },
];

export default contactData;
